  return (
    <div
      style={{
        display: "flex",
        justifyContent: "left",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <h1 id="h1">
        <Sidebar />
        개발자, <p />
        어떤 사람이여야 될까요?
      </h1>
    </div>
  );
};

export default Home;
